import React from 'react';
import { motion } from 'framer-motion';

function Work() {
  const projectVariants = {
    hover: {
      scale: 1.05,
      transition: { duration: 0.3 },
    },
  };

  return (
    <section id="work" className="py-5 bg-dark text-white">
      <div className="container">
        <h2 className="display-4 text-orange mb-4">My Work</h2>
        <div className="row">
          <div className="col-md-6 mb-4">
            <motion.div className="card bg-secondary text-white" variants={projectVariants} whileHover="hover">
              <img src="/images/case-study-1-thumb.jpg" className="card-img-top" alt="Fitness App" />
              <div className="card-body">
                <h5 className="card-title">Fitness App</h5>
                <p className="card-text">Ideation, wireframing, and prototyping for a fitness application.</p>
              </div>
            </motion.div>
          </div>
          <div className="col-md-6 mb-4">
            <motion.div className="card bg-secondary text-white" variants={projectVariants} whileHover="hover">
              <img src="/images/case-study-2-thumb.jpg" className="card-img-top" alt="Food Delivery" />
              <div className="card-body">
                <h5 className="card-title">Home Office Food Delivery</h5>
                <p className="card-text">Video prototype for a food delivery concept for remote teams.</p>
              </div>
            </motion.div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Work;
